import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';

class App extends React.Component {
  render() {
    return (
        <div className="App">
          <header className="App-header">
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
          </header>
        </div>
    );
  }
}

export default App;
